pop_kwn_hst (){
   local D
   local H
   case $MNAM in
      h.populate_known_hosts)
         $KSCN $MLST >> $KWNH
         ;;
      h.populate_known_hosts_slow)
         if [ ! -z $1 ] 2>$DN ; then
            D="sleep $1"
         else
            D="sleep .1"
         fi
         for H in $(cat $MLST) ; do
            $KSCL $H >> $KWNH
            $D
         done
      ;;
   esac
   sort -u $KWNH > $KWNH.now.$$
   mv $KWNH.now.$$ $KWNH
}
